`,paraId:0},{value:"88.\u5408\u5E76\u4E24\u4E2A\u6709\u5E8F\u6570\u7EC4",paraId:0},{value:"easy",paraId:0},{value:"\u65F6\u95F4\u590D\u6742\u5EA6 O(n)",paraId:12,tocIndex:16},{value:"\u53CC\u6307\u9488\u6CD5\uFF0C\u4ECE\u5934\u5F00\u59CB\u5BF9\u6BD4\uFF0C\u5C06\u5BF9\u6BD4\u7ED3\u679C\u653E\u5165\u4E00\u4E2A\u65B0\u6570\u7EC4\u4E2D\uFF0C",paraId:0},{value:"\u7136\u540E\u518D\u6839\u636E\u65B0\u6570\u7EC4\u7684\u7ED3\u679C\uFF0C\u6539\u53D8 nums1",paraId:0},{value:`/**
 * @param {number[]} nums1
 * @param {number} m
 * @param {number[]} nums2
 * @param {number} n
 * @return {void} Do not return anything, modify nums1 in-place instead.
 */
// \u53CC\u6307\u9488\u6CD5
var merge = function (nums1, m, nums2, n) {
  let p1 = 0,
    p2 = 0;
  let sortArr = new Array(m + n).fill(0);
  let cur;
  while (p1 < m || p2 < n) {
    let n1 = nums1[p1];
    let n2 = nums2[p2];
    if (p1 === m) {
      // \u5F53p1\u8D70\u5230\u5934
      cur = n2;
      p2++;
    } else if (p2 === n) {
      // \u5F53p2\u8D70\u5230\u5934
      cur = n1;
      p1++;
    } else if (n1 < n2) {
      // \u5F53n1\u5C0F\u4E8En2\uFF0C\u5219\u5F53\u524D\u6570\u5B57\u4E3An1
      cur = n1;
      p1++;
    } else {
      // \u5F53n1\u5927\u4E8En2\uFF0C\u5219\u5F53\u524D\u6570\u5B57\u4E3An2
      // \u5F53n1\u7B49\u4E8En2\uFF0C\u968F\u610F\u53D6\u4E00\u4E2A\uFF0C\u8FD9\u91CC\u5C31\u53D6n2
      cur = n2;
      p2++;
    }
    sortArr[p1 + p2 - 1] = cur;
  }

  for (let i = 0; i < sortArr.length; i++) {
    nums1[i] = sortArr[i];
  }
};
// ----------------------------------------------------------------
// \u8FD9\u91CC\u5C06nums2\u622A\u53D6\u5230nums1\u4E2D\uFF0C\u7136\u540E\u6392\u5E8F
var merge1 = function (nums1, m, nums2, n) {
  nums1.splice(m, n, ...nums2);
  nums1.sort((a, b) => a - b);
};
